import React, { Component } from 'react';
import './App.css';
import axios from 'axios';
const url = 'https://www.api-football.com/demo/v2/';

class App extends Component {
	constructor(props) {
		super(props);
		this.state = {
			///setting State for data being brought in below
			data: [],
		};
  }

	componentDidMount() {
    axios('https://www.api-football.com/demo/v2/')
    .then((json) => {
      this.setState({ data: json.data });
    })
    .catch(console.error);
  }

	render() {
		return <div></div>;
	}
}

export default App;
